    $templateCache.put("catalog/help/images.html", "<div class=\"help-item\">\n  <div>\n  Images play perhaps the most important role in terms of\n  sales and marketing success on the Miraclestyle platform.\n  That is why you should make sure your images look\n  visually pleasing and impeccable while conveying desired information at the same time.\n  Catalog images represent catalog pages arranged one next to another\n  while the catalog is being viewed.\n  Catalog images should be prepared in such manner as if they were\n  to be printed pages of a mail-order catalog or magazine.\n  </div>\n  <div class=\"padding-bottom-8\">\n  Here are few important guidelines to help you with catalog images preparation:\n  </div>\n  <div>\n  - the first image, the one at the upper left corner of the images grid, serves as the catalog cover;\n  </div>\n  <div>\n  - the catalog cover should be of 1:1 aspect ratio (the system enforces this ratio);\n  </div>\n  <div>\n  - maintain the same aspect ratio across all non-cover images (they don't have to be 1:1 ratio);\n  </div>\n  <div>\n  - images should be of overall high quality, preferably in Full HD resolution, for an optimal viewing experience on a variety of displays;\n  </div>\n  <div>\n  - avoid uploading multiple images with the same contents, e.g. same product or combination of products presented from different angles;\n  </div>\n  <div>\n  - an image should contain enough product details to make a product recognizable;\n  </div>\n  <div class=\"padding-bottom-8\">\n  - image contents should be optimized for viewing experience on small display sizes,\n  i.e. make sure image contents are recognizable while viewed on small display sizes.\n  </div>\n  <div class=\"padding-bottom-8\">\n  Catalog images will appear ordered the way you have manually ordered them.\n  </div>\n  <div class=\"padding-bottom-8\">\n  Click <icon type=\"file_upload\"></icon> to select new images for upload.\n  </div>\n  <div class=\"padding-bottom-8\">\n  Use <icon type=\"reorder\"></icon> to reorder an image by dragging it within its group.\n  </div>\n  <div>\n  Use <icon type=\"reorder\"></icon> to remove an image by dragging it outside the left edge of the screen.\n  </div>\n</div>");
    $templateCache.put("catalog/help/list.html", "<div class=\"help-item\">\n    <div class=\"padding-bottom-8\">\n    Catalogs are an integral part of the Miraclestyle platform. A catalog is a collection of images that represent products or services to be sold. Each image can have multiple price tags attached. Each price tag is custom positioned on an image and links to product details. Product details contain information detailing characteristics of the product (or service) to be sold. Product is integrated with the shopping cart system to allow direct online purchases. When created, a catalog initially assumes draft state and is not accessible to the general public. While in draft state, a catalog can be edited. A published catalog is accessible to the general public and can be shared and embedded to third party websites. With an exception of a product \"Availability\" field, a published catalog cannot be edited. However, a published catalog can be duplicated, and the duplicate is ready for editing. A discontinued catalog is not accessible to the general public and is eventually entirely removed from the Miraclestyle. However, products of a discontinued catalog remain accessible for the 180 days to those who have purchased them. A discontinued catalog cannot be edited or duplicated. Your catalogs will appear ordered the way you have created them.\n    </div>\n    <div class=\"padding-bottom-8\">\n    Click the \"Create\" button to create a new catalog.\n    </div>\n    <div class=\"padding-bottom-8\">\n    Click on a catalog cover image to edit the catalog.\n    </div>\n    <div>\n    Click <icon type=\"view_carousel\"></icon> to view the catalog as it would appear to the general public.\n    </div>\n</div>");
